import React from "react";

function Home() {
    return (
        <div className="Home">
            <h1> About Me </h1>
            <img src="resources/AboutMe_ProfileImage.jpg" width="300px"/>
            <p>I am a 21-year-old MSLS student who has turned my passion for public libraries into my career.
                When I'm not working or studying, I'm usually reading and sharing what I've read with others.</p>
        </div>
    );
}

export default Home;
